import styles from './Navigation.module.css'
import {Card} from 'react-bootstrap'

const Cart = () => {
    return(
        <Card>
            <i class="fas fa-shopping-cart"></i>
            <div className={styles.cart}>Your Cart</div>
        </Card>
    )
}

export default Cart;
